@prefix : <http://www.semanticweb.org/ontologies/healthcare#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:HealthcareSystem rdf:type owl:Class .
:LaboratoryEquipment rdf:type owl:Class .
:HL7 rdf:type owl:Class .
:integrateWith rdf:type owl:ObjectProperty .

:integrateWith rdf:domain :HealthcareSystem .
:integrateWith rdf:range [
  rdf:type owl:Class;
  owl:unionOf ( :LaboratoryEquipment :HL7 )
] .
